import React from 'react';
import './App.css';
import {LandingPageView} from "./Views/landing-page/landing-page-view";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

function App() {
  return (
      <div className="CatmanApp">
        <Router>
                <nav>
                    <ul>
                        <li> <Link to="/">Home</Link> </li>
                        <li> <Link to="/manage-attributes">Attributes</Link> </li>
                        <li> <Link to="/manage-attribute-groups">Attribute Groups</Link> </li>
                        <li> <Link to="/manage-attribute-mappings">Attribute Mappings</Link>
                            <li> <Link to="/manage-classes">Classes</Link> </li>
                        </li>
                    </ul>
                </nav>
                <Switch>
                    <Route path="/manage-attributes">
                       <h2>Manage Attributes</h2>
                    </Route>
                    <Route path="/">
                        <LandingPageView message={"this is the landing page"}/>
                    </Route>
                </Switch>
        </Router>
      </div>
  );
}

export default App;
